void ::Parser::Parser::lazyParse() {
            if (lexer == nullptr) {
                Lexer lexer(text);
                auto pos = Lexer::lazy_iterator(lexer, text);
                parseFromPos(pos, action_table, goto_table, rules_table, dfa_table);
            } else {
                auto pos = Lexer::lazy_iterator(lexer, text);
                parseFromPos(pos, action_table, goto_table, rules_table, dfa_table);
            }
        }

